const request = require('request');
const Promise = require('promise');
const _ = require('lodash');

function getEventDate() {
    const date = getRandomDate(new Date(2019, 1, 1), new Date())
    return date.split("T")[0];
}

function getRandomDate(start, end) {
    return new Date(start.getTime() + Math.random() * (end.getTime() - start.getTime())).toISOString();
}

async function uploadRandomEvents(serverUrl, headers, payLoad) {
    const url = `${serverUrl}/api/events.json`;
    return new Promise(resolve => {
        request({
                headers,
                uri: url,
                method: 'POST',
                body: JSON.stringify(payLoad)
            },
            (error, responseObj, body) => {
                // console.log(body)
                body = JSON.parse(body);
                const {
                    response,
                    httpStatus,
                    httpStatusCode
                } = body;
                const {
                    imported,
                    updated,
                    deleted,
                    ignored
                } = response
                resolve({
                    httpStatus,
                    httpStatusCode,
                    imported,
                    updated,
                    deleted,
                    ignored
                });
            }
        );
    });
}


function deleteEventById(serverUrl, headers, eventId) {
    const url = `${serverUrl}/api/events/${eventId}`;
    return new Promise(resolve => {
        request({
                headers,
                uri: url,
                method: 'DELETE'
            },
            (error, response, body) => {
                if (!error && response) {
                    resolve();
                } else {
                    console.log(error);
                    console.log(response);
                    resolve()
                }
            }
        );
    })
}

function getSampleEventPayLoad(programId) {
    const eventData = getEventDataByProgram(programId);
    const sampleEvents = [];
    const nonDataValueKey = ["event", "program", "programStage", "orgUnit", "status", "eventDate", "completedDate"];
    for (const data of eventData) {
        const dataValues = [];
        // randomize event date as well as error date
        const eventDate = getEventDate();
        let hour = _.random(0, 23);
        hour = hour > 9 ? hour : `0${hour}`;
        const minutes = _.random(10, 59);
        const eventDateTime = `${eventDate} ${hour}:${minutes}`;
        Object.keys(data).map(key => {
            if (nonDataValueKey.indexOf(key) === -1) {
                const value = key === "ZNwpWM0xDtS" ? eventDateTime : data[key] || "";
                dataValues.push({
                    dataElement: key,
                    value
                })
            }
        });
        sampleEvents.push({
            "event": data["event"],
            "program": data["program"],
            "programStage": data["programStage"],
            "orgUnit": data["orgUnit"],
            "status": data["status"],
            "eventDate": eventDate,
            "completedDate": eventDate,
            dataValues
        })
    }
    return sampleEvents;
}



function getEventData(serverUrl, headers, programId, ouid) {
    const url = `${serverUrl}/api/events.json?orgUnit=${ouid}&program=${programId}`;
    return new Promise(resolve => {
        request({
                headers,
                uri: url,
                method: 'GET'
            },
            (error, response, body) => {
                if (!error && response && response.statusCode === 200) {
                    body = JSON.parse(body);
                    const {
                        events
                    } = body;
                    resolve(
                        events
                    );
                } else {
                    resolve([]);
                }
            }
        );
    })
}

